import React from 'react';
import Link from 'next/link';

const Navbar = () => (
    <div>
        <ul>
            <li>
                <Link href='/'><a>Inicio</a></Link>
                <Link href='/nosotros'><a>Nosotros</a></Link>
            </li>
        </ul>
        <style jsx>{`
        ul {
            background-color: #333;
            list-style: none;
            display: flex
        }
        `}
        </style>
    </div>
);

export default Navbar;
